/*Table structure for table `location_type` */

DROP TABLE IF EXISTS `location_type`;

CREATE TABLE `location_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `description` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Data for the table `location_type` */

insert  into `location_type`(`id`,`description`) values (1,'TEMPORARY'),(2,'ACTUAL'),(3,'UNKNOWN');

/*Table structure for table `picklist_headers_tab` */

DROP TABLE IF EXISTS `picklist_headers_tab`;

CREATE TABLE `picklist_headers_tab` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `picklist_source_id` int(11) DEFAULT NULL,
  `picklist_no` varchar(20) DEFAULT NULL,
  `sales_order_no` varchar(50) DEFAULT NULL,
  `sales_order_type` varchar(25) DEFAULT NULL,
  `sales_order_date` datetime DEFAULT NULL,
  `customer_delivery_address` varchar(150) DEFAULT NULL,
  `customer_contact_person` varchar(100) DEFAULT NULL,
  `customer_name` varchar(100) DEFAULT NULL,
  `customer_id` varchar(20) DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `additional_remarks` varchar(255) DEFAULT NULL,
  `xml_file_type_id` int(11) DEFAULT NULL,
  `filename` varchar(100) DEFAULT NULL,
  `cancel` tinyint(1) DEFAULT '0',
  `shipped` tinyint(1) DEFAULT '0',
  `date_created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sales_order_no` (`sales_order_no`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `picklist_headers_tab` */

/*Table structure for table `picklist_lines_tab` */

DROP TABLE IF EXISTS `picklist_lines_tab`;

CREATE TABLE `picklist_lines_tab` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `picklist_header_id` int(11) DEFAULT NULL,
  `line_no` int(11) DEFAULT NULL,
  `part_no` varchar(50) DEFAULT NULL,
  `part_description` varchar(150) DEFAULT NULL,
  `requested_quantity` decimal(20,4) DEFAULT NULL,
  `actual_quantity` decimal(20,4) DEFAULT NULL,
  `unit_of_measure` varchar(20) DEFAULT NULL,
  `promise_date` datetime DEFAULT NULL,
  `date_created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `picklist_lines_tab` */

